INSERT INTO `sessionratings` VALUES ('bu2hhrti7nd0md7faomg','bu2hhrti7nd0md7faom0',3,'I protest, even warmly, that neither he nor his sorrows were in my intention.','2020-10-13 03:03:12'),('bu2hhrti7nd0md7faon0','bu2hhrti7nd0md7faom0',5,'One dog rolled before him, well-nigh slashed in half; but a second had him by the thigh, a third gripped his collar be- hind, and a fourth had the blade of the sword between its teeth, tasting its own blood.','2020-10-13 03:03:12'),('bu2hhrti7nd0md7faong','bu2hhrti7nd0md7faom0',2,'The Nellie, a cruising yawl, swung to her anchor without a flutter of the sails, and was at rest.','2020-10-13 03:03:12'),('bu2hhrti7nd0md7faoo0','bu2hhrti7nd0md7faom0',4,'It was at this time that the meeting, or, rather gathering of the mem- bers of this inharmonious family took place in the cell of the elder who had such an extraordinary influence on Alyosha.','2020-10-13 03:03:12'),('bu2hhrti7nd0md7faoog','bu2hhrti7nd0md7faom0',1,'Have I come to Utopia to hear this sort of thing?','2020-10-13 03:03:12'),('bu2hhrti7nd0md7faop0','bu2hhrti7nd0md7faom0',1,'One dog rolled before him, well-nigh slashed in half; but a second had him by the thigh, a third gripped his collar be- hind, and a fourth had the blade of the sword between its teeth, tasting its own blood.','2020-10-13 03:03:12'),('bu2hhrti7nd0md7faopg','bu2hhrti7nd0md7faom0',2,'And with that he went off to see my father, taking me with him by the arm.','2020-10-13 03:03:12'),('bu2hhrti7nd0md7faoq0','bu2hhrti7nd0md7faom0',1,'It is a truth universally acknowledged, that a single man in possession of a good fortune, must be in want of a wife.','2020-10-13 03:03:12'),('bu2hhrti7nd0md7faoqg','bu2hhrti7nd0md7faom0',5,'It is a truth universally acknowledged, that a single man in possession of a good fortune, must be in want of a wife.','2020-10-13 03:03:12'),('bu2hhrti7nd0md7faor0','bu2hhrti7nd0md7faom0',2,'I protest, even warmly, that neither he nor his sorrows were in my intention.','2020-10-13 03:03:12'),(