d his collar be- hind, and a fourth had the blade of the sword between its teeth, tasting its own blood.','2020-10-13 03:03:12'),('bu2hhrti7nd0md7fap0g','bu2hhrti7nd0md7faosg',4,'Then followed a battle of looks between them, but the captain soon knuckled under, put up his weapon, and resumed his seat, grumbling like a beaten dog.','2020-10-13 03:03:12'),('bu2hhrti7nd0md7fap10','bu2hhrti7nd0md7faosg',4,'It is no doubt an optimistic enterprise. But it is good for awhile to be free from the carping note that must needs be audible when we discuss our present imperfections, to release ourselves from practical difficulties and the tangle of ways and means. It is good to stop by the track for a space, put aside the knapsack, wipe the brows, and talk a little of the upper slopes of the mountain we think we are climbing, would but the trees let us see it','2020-10-13 03:03:12'),('bu2hhrti7nd0md7fap1g','bu2hhrti7nd0md7faosg',3,'One dog rolled before him, well-nigh slashed in half; but a second had him by the thigh, a third gripped his collar be- hind, and a fourth had the blade of the sword between its teeth, tasting its own blood.','2020-10-13 03:03:12'),('bu2hhrti7nd0md7fap20','bu2hhrti7nd0md7faosg',3,'Then followed a battle of looks between them, but the captain soon knuckled under, put up his weapon, and resumed his seat, grumbling like a beaten dog.','2020-10-13 03:03:12'),('bu2hhrti7nd0md7fap2g','bu2hhrti7nd0md7faosg',3,'I am all in a sea of wonders. I doubt; I fear; I think strange things, which I dare not confess to my own soul. God keep me, if only for the sake of those dear to me!','2020-10-13 03:03:12'),('bu2hhrti7nd0md7fap3g','bu2hhrti7nd0md7fap30',1,'I protest, even warmly, that neither he nor his sorrows were in my intention.','2020-10-13 03:03:12'),('bu2hhrti7nd0md7fap40','bu2hhrti7nd0md7fap30',1,'He spoke of the happiness that was now certainly theirs, of the folly of not breaking sooner out of that magnificent prison of latter-day life, of the old romantic da